import './App.css';
import React from "react";


class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            city: null
        }
    }

    doSubmit(event) {
        console.log(event);
    }

    render() {
        return (
            <div className="App">
                <h1>Test</h1>
                <form className="GetForm" onSubmit={this.doSubmit}>
                    <input type="text"/>
                    <button type="submit">Get</button>
                </form>
            </div>
        );
    }
}

export default App;
